import React from "react";
import "./Card.css";
export default function Card({name, img, type,Types}){

   
    return(
        <div className="card">
                <h3 className="title">{name}</h3>
                <div className="imgDiv">
                <img src={img} alt="img not found" className="imgPoke"/>
                </div>
                <div className="typesDiv">
                <h4 className="subtitle">Tipo</h4>
                <h5 className="types">{type? type + ' ' : Types.map(el=>el.name + (' '))}</h5>
            
                </div>
                
                
                
        
        </div>
        
    );
}
